import React,{Component} from 'react'
import './App.css';
import stateVideo from './stateVideo'
import Nav from './component/Nav'
import AdminVideo from './component/AdminVideo'


class App extends Component{

  state={
    video:stateVideo
  }


  render(){
   return (
      <>
        <Nav state={this.state}></Nav>
        <AdminVideo state={this.state}/>
      </>
    );
  }
}

export default App;
